import React, { Fragment } from 'react'
import mealsImage from '../../assets/meals.jpg'
const Header =(props)=>{
    return (
        <Fragment>
            <header>
                <h1>ReactMeals</h1>
                <button>Cart</button>
            </header>
            <div>
                <img srch={mealsImage} alt="if not image"/>

            </div>


        </Fragment>
    )
}
export default Header;
